import React, { useState } from "react";
import UploadCV from "./components/UploadCV";

export default function App() {
  const [cvData, setCvData] = useState(null);

  return (
    <div style={{ padding: 20 }}>
      <h1>CV ATS System</h1>

      <UploadCV setData={setCvData} />

      {cvData && (
        <div style={{ marginTop: 20 }}>
          <h2>Extracted CV Data:</h2>
          <p><strong>Name:</strong> {cvData.name}</p>
          <p><strong>Email:</strong> {cvData.email}</p>
          <p><strong>Phone:</strong> {cvData.phone}</p>
          <h3>Education:</h3>
          <ul>
            {cvData.education?.map((edu, i) => <li key={i}>{edu}</li>)}
          </ul>
          <h3>Experience:</h3>
          <ul>
            {cvData.experience?.map((exp, i) => <li key={i}>{exp}</li>)}
          </ul>
          <h3>Projects:</h3>
          <ul>
            {cvData.projects?.map((proj, i) => <li key={i}>{proj}</li>)}
          </ul>
        </div>
      )}
    </div>
  );
}
